function FreeMotionSDFData:GetGetDistanceDataIndex(u, v, offsetX, offsetY)
    local i = math.floor(127 * u + offsetX)
    local j = math.floor(127 * v + offsetY)
    local index = j * 128 + i + 1
    math.clamp(index, 1, 16384) 
    return index
end

